import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';  // Cambié el nombre del archivo para seguir buenas prácticas
import LogoSvg from '../Logo.svg';

// Componente Navbar
const Navbar = () => {
  return (
    <nav className="navbar">
      {/* Contenedor del logo */}
      <div className="logo-container">
        <Link to="/">
          <img src={LogoSvg} alt="CCAL Logo" className="logo" />
        </Link>
      </div>

      {/* Contenedor de los enlaces de navegación */}
      <div className="nav-links-container">
        <ul className="nav-links">
          {/* Enlace a la página de Inicio */}
          <li className="nav-item">
            <Link to="/" className="nav-link">
              Inicio
            </Link>
          </li>
          {/* Enlace a la página de Conócenos */}
          <li className="nav-item">
            <Link to="/categorias" className="nav-link">
              Conócenos
            </Link>
          </li>
          {/* Enlace a la página de Admisión */}
          <li className="nav-item">
            <Link to="/favoritos" className="nav-link">
              Logros
            </Link>
          </li>
          {/* Enlace a la página de Contáctanos */}
          <li className="nav-item">
            <Link to="/admisión" className="nav-link">
              Admisión
            </Link>
          </li>
          {/* Enlace a la página de Logros */}
          <li className="nav-item">
            <Link to="/contacto" className="nav-link">
              Contáctanos
            </Link>
          </li>
        </ul>
      </div>

      {/* Botón de menú (para dispositivos móviles) */}
      <button className="menu-toggle">
        <span className="menu-icon">☰</span>
      </button>
    </nav>
  );
};

export default Navbar;
